import React from 'react';

const Party = ({ member, party }) => {
    return(
        <div>
            <h3>You are: {member.name}</h3>

            <h5>Members</h5>

            {party && party.members.map(member => {
                <h2>{member.name}</h2>
            })}

            <h2>{party.entryCode}</h2>
        </div>
    )
}

export default Party;
